import React from 'react';
import Mtitle from './MainTitle';
import Navbar from './NavBar';
import Gallery from './Gallery';
import './Style.css';



function App() {
  return (
    <div className="app-container">
      <header>
        <Mtitle/>{}
        <Navbar/>{}
        <Gallery/>{}
      </header>
    </div>
  );
}

export default App;
